Match_Results = []
for matches in results_data['matchDetails']:
    if not matches.get('matchDetailsMap'):
        continue
    #match_date=(i['matchDetailsMap']['key'])
    for match1 in matches['matchDetailsMap']['match']:
        raw_ts = match1['matchInfo']['startDate']
        #print("Raw Timestamp:", raw_ts)

        start_date = datetime.fromtimestamp(int(match1['matchInfo']['startDate']) / 1000).strftime('%Y-%m-%d')

        
        MatchDetails = { 
            "MatchDesc" : match1['matchInfo']['matchDesc'],
            "Team1" : match1['matchInfo']['team1']['teamName'],
            "Team2" : match1['matchInfo']['team2']['teamName'],
            "Winning Team" : match1['matchInfo']['status'],
            "Venue" : match1['matchInfo']['venueInfo']['ground'],
            "StartDate" : start_date
        }
        Match_Results.append(MatchDetails)
