# Initialize player stats dictionary for RR players only
player_stats = {}

# Process each match
for match in rr_matches_sc:
    for innings in match['scorecard']:
        # Process RR batting innings
        if innings.get('batteamname') == 'Rajasthan Royals':
            for batsman in innings['batsman']:
                player_id = batsman['id']
                player_name = batsman['name']
                
                if player_id not in player_stats:
                    player_stats[player_id] = {
                        'player_id': player_id,
                        'player_name': player_name,
                        'matches': 0,
                        'innings_batted': 0,
                        'runs': 0,
                        'balls_faced': 0,
                        'not_outs': 0,
                        'wickets': 0,
                        'balls_bowled': 0,
                        'runs_conceded': 0,
                        'catches': 0,
                        'stumpings': 0,
                        'runouts': 0
                    }
                
                # Increment matches
                player_stats[player_id]['matches'] += 1
                
                # Update batting stats
                if batsman['balls'] > 0:
                    player_stats[player_id]['innings_batted'] += 1
                    player_stats[player_id]['runs'] += batsman['runs']
                    player_stats[player_id]['balls_faced'] += batsman['balls']
                    
                    # Check if not out
                    if 'not out' in batsman.get('outdec', '').lower():
                        player_stats[player_id]['not_outs'] += 1
        
        # Process RR bowling innings (when opponent is batting)
        else:
            # Check if 'bowler' key exists in innings
            if 'bowler' in innings:
                for bowler in innings['bowler']:
                    player_id = bowler['id']
                    
                    # Only process if this is an RR player
                    if player_id in rr_player_ids:
                        if player_id not in player_stats:
                            player_stats[player_id] = {
                                'player_id': player_id,
                                'player_name': bowler['name'],
                                'matches': 1,
                                'innings_batted': 0,
                                'runs': 0,
                                'balls_faced': 0,
                                'not_outs': 0,
                                'wickets': 0,
                                'balls_bowled': 0,
                                'runs_conceded': 0,
                                'catches': 0,
                                'stumpings': 0
                            }
                        
                        # Update bowling stats
                        player_stats[player_id]['wickets'] += bowler['wickets']
                        player_stats[player_id]['balls_bowled'] += bowler['balls']
                        player_stats[player_id]['runs_conceded'] += bowler['runs']

# Process catches and stumpings from opponent dismissals (outdec)
for match in rr_matches_sc:
    for innings in match['scorecard']:
        # Only check opponent batting innings
        if innings.get('batteamname') != 'Rajasthan Royals':
            for batsman in innings['batsman']:
                outdec = batsman.get('outdec', '')
                
                # Check for catches
                if 'c ' in outdec and ' b ' in outdec:
                    # Extract fielder name from "c FielderName b BowlerName"
                    try:
                        fielder_part = outdec.split('c ')[1].split(' b ')[0].strip()
                        # Match with RR players
                        for pid, pstats in player_stats.items():
                            player_name_lower = pstats['player_name'].lower()
                            fielder_part_lower = fielder_part.lower()
                            # Check various name matches
                            if (fielder_part_lower == player_name_lower or 
                                fielder_part_lower in player_name_lower or 
                                player_name_lower in fielder_part_lower or
                                # Handle specific cases
                                (fielder_part_lower == 'buttler' and 'buttler' in player_name_lower) or
                                (fielder_part_lower == 'jurel' and 'jurel' in player_name_lower) or
                                (fielder_part_lower == 'burger' and 'burger' in player_name_lower)):
                                player_stats[pid]['catches'] += 1
                                break
                    except:
                        pass
                
                # Check for runouts
                if 'run out' in outdec.lower():
                    # Extract fielder name(s) from various runout formats
                    # Examples: "run out (Fielder1)", "run out (Fielder1/Fielder2)", "run out (Fielder)"
                    try:
                        if '(' in outdec and ')' in outdec:
                            fielders_part = outdec.split('(')[1].split(')')[0].strip()
                            # Handle multiple fielders separated by /
                            fielders = [f.strip() for f in fielders_part.split('/')]
                            
                            for fielder in fielders:
                                # Match with RR players
                                for pid, pstats in player_stats.items():
                                    player_name_lower = pstats['player_name'].lower()
                                    fielder_lower = fielder.lower()
                                    if (fielder_lower == player_name_lower or 
                                        fielder_lower in player_name_lower or 
                                        player_name_lower in fielder_lower or
                                        # Handle specific cases
                                        (fielder_lower == 'buttler' and 'buttler' in player_name_lower) or
                                        (fielder_lower == 'jurel' and 'jurel' in player_name_lower) or
                                        (fielder_lower == 'samson' and 'samson' in player_name_lower)):
                                        player_stats[pid]['runouts'] += 1
                                        break
                    except:
                        pass
                
                # Check for stumpings
                if 'st ' in outdec:
                    # Extract keeper name from "st KeeperName b BowlerName"
                    try:
                        keeper_part = outdec.split('st ')[1].split(' b ')[0].strip()
                        # Match with RR players
                        for pid, pstats in player_stats.items():
                            player_name_lower = pstats['player_name'].lower()
                            keeper_part_lower = keeper_part.lower()
                            if (keeper_part_lower == player_name_lower or 
                                keeper_part_lower in player_name_lower or 
                                player_name_lower in keeper_part_lower):
                                player_stats[pid]['stumpings'] += 1
                                break
                    except:
                        pass

# Calculate averages and rates
for player_id, stats in player_stats.items():
    # Ensure runouts field exists
    if 'runouts' not in stats:
        stats['runouts'] = 0
    
    # Batting average
    innings_dismissed = stats['innings_batted'] - stats['not_outs']
    if innings_dismissed > 0:
        stats['batting_avg'] = round(stats['runs'] / innings_dismissed, 2)
    else:
        stats['batting_avg'] = 0 if stats['runs'] == 0 else stats['runs']
    
    # Strike rate
    if stats['balls_faced'] > 0:
        stats['strike_rate'] = round((stats['runs'] / stats['balls_faced']) * 100, 2)
    else:
        stats['strike_rate'] = 0
    
    # Bowling average
    if stats['wickets'] > 0:
        stats['bowling_avg'] = round(stats['runs_conceded'] / stats['wickets'], 2)
    else:
        stats['bowling_avg'] = 0
    
    # Economy rate
    if stats['balls_bowled'] > 0:
        overs = stats['balls_bowled'] / 6
        stats['economy'] = round(stats['runs_conceded'] / overs, 2)
    else:
        stats['economy'] = 0

