response = requests.get(url, headers=headers)

print(response.json())
seriesdata=response.json()


# In[188]:


match_ids = []

for item in seriesdata.get("matchDetails", []):
    details = item.get("matchDetailsMap", {})
    matches = details.get("match", [])
    
    for m in matches:
        match_info = m.get("matchInfo", {})
        match_id = match_info.get("matchId")
        
        if match_id:   # Only add valid IDs
            match_ids.append(match_id)

print(match_ids)


# In[189]:


import requests
total_matches_sc=[]
for each in match_ids:
    url = f"https://cricbuzz-cricket.p.rapidapi.com/mcenter/v1/{each}/scard"

    headers = {
        "x-rapidapi-key": "ab233b97admshfd174790c367d6dp11ad4ejsn769273b5232f",
        "x-rapidapi-host": "cricbuzz-cricket.p.rapidapi.com"
    }
    try:
        response = requests.get(url, headers=headers)
        total_matches_sc.append(response.json())
    except:
        continue
total_matches_sc


# In[190]:


team_name = "Chennai Super Kings"
csk_match_no = 0
final_output = []

for match in total_matches_sc:   
    scorecards = match["scorecard"]

    
    csk_innings = None
    for inng in scorecards:
        if inng.get("batteamname") == team_name:
            csk_innings = inng
            break

    if csk_innings is None:
        continue

    csk_match_no += 1

    batsmen = csk_innings.get("batsman", [])

    for b in batsmen:

        player_id = b.get("id")
        player_name = b.get("name")
        runs = b.get("runs", 0)

        sr = b.get("strkrate", "0")
        sr = float(sr) if sr not in ["", None] else 0.0

        out_text = b.get("outdec", "")
        not_out = 1 if out_text == "" or out_text == "not out" else 0

        final_output.append({
            "match_no": csk_match_no,
            "player_id": player_id,
            "player_name": player_name,
            "runs": runs,
            "strike_rate": sr,
            "not_out": not_out
        })



# In[191]:


final_output


# In[192]:


csk_batt_stats=pd.DataFrame(final_output)
csk_batt_stats


# In[193]:


import pandas as pd

players = csk_batt_stats["player_id"].unique()
result = []

for pid in players:
    pdf = csk_batt_stats[csk_batt_stats["player_id"] == pid].sort_values("match_no")

    last_10 = pdf.tail(10)
    last_5  = pdf.tail(5)


    avg_last5 = last_5["runs"].mean() if len(last_5) > 0 else 0
    avg_last10 = last_10["runs"].mean() if len(last_10) > 0 else 0

    
    sr_last = last_10["strike_rate"].iloc[-1] if len(last_10) > 0 else 0
    sr_avg10 = last_10["strike_rate"].mean() if len(last_10) > 0 else 0
    sr_trend = sr_last - sr_avg10

 
    fifties = (last_10["runs"] >= 50).sum()

    
    consistency = last_10["runs"].std() if len(last_10) > 1 else 0

    result.append({
        "player_id": pid,
        "player_name": pdf["player_name"].iloc[0],
        "avg_last_5": round(avg_last5, 2),
        "avg_last_10": round(avg_last10, 2),
        "strike_rate_trend": round(sr_trend, 2),
        "fifties_last_10": int(fifties),
        "consistency_score": round(consistency, 2)
    })

csk_batt_table = pd.DataFrame(result)


