# In[2]:


partnership_rows = []

for match in total_matches_sc:
    for inng in match["scorecard"]:        
        batting_map = {}
        bats_list = inng.get("batsman", [])
        for i, b in enumerate(bats_list, start=1):
            batting_map[b["id"]] = i  

        
        if "partnership" not in inng:
            continue
        
        plist = inng["partnership"].get("partnership", [])

        for p in plist:
            bat1 = p["bat1id"]
            bat2 = p["bat2id"]
            name1 = p["bat1name"]
            name2 = p["bat2name"]
            runs = p["totalruns"]
            balls = p["totalballs"]

            
            pos1 = batting_map.get(bat1)
            pos2 = batting_map.get(bat2)

            
            if pos1 is None or pos2 is None:
                continue

            if abs(pos1 - pos2) == 1:
                
                if pos1 < pos2:
                    p1_id, p1_name = bat1, name1
                    p2_id, p2_name = bat2, name2
                else:
                    p1_id, p1_name = bat2, name2
                    p2_id, p2_name = bat1, name1

                partnership_rows.append({
                    "player1_id": p1_id,
                    "player1_name": p1_name,
                    "player2_id": p2_id,
                    "player2_name": p2_name,
                    "runs": runs,
                    "balls": balls,
                    "player1_pos": min(pos1, pos2),
                    "player2_pos": max(pos1, pos2)
                })


# In[3]:


partnership_rows


# In[6]:


import pandas as pd
dfp = pd.DataFrame(partnership_rows)

groups = dfp.groupby(["player1_id", "player2_id", "player1_name", "player2_name"])

results = []

for (p1_id, p2_id, p1_name, p2_name), g in groups:
    
    total_ps = len(g)

    
    if total_ps < 5:
        continue

    avg_runs = g["runs"].mean()
    fifty_plus = (g["runs"] >= 50).sum()
    highest = g["runs"].max()

    success_rate = (fifty_plus / total_ps) * 100

    results.append({
        "player1_id": p1_id,
        "player1_name": p1_name,
        "player2_id": p2_id,
        "player2_name": p2_name,
        "total_partnerships": total_ps,
        "avg_runs": round(avg_runs, 2),
        "fifty_plus_partnerships": fifty_plus,
        "highest_partnership": highest,
        "success_rate_percent": round(success_rate, 2)
    })

partner_summary_df = pd.DataFrame(results)
print(partner_summary_df)


