qtr_data = []

for idx, match in enumerate(sc_details, start=1):
    match_no = idx  # Match counter

    for inns in match.get("scorecard", []):
        if inns.get("batteamname", "").lower().strip() != "india":
            continue

        for b in inns.get("batsman", []):
            qtr_data.append({
                "match_no": match_no,
                "name": b.get("name", ""),
                "player_id": b.get("id", ""),
                "runs": b.get("runs", 0),
                "balls": b.get("balls", 0),
                "strike_rate": float(b.get("strkrate", 0) or 0),
                "not_out": 1 if b.get("outdec", "").lower() == "not out" else 0
            })


# In[15]:


df=pd.DataFrame(qtr_data)


# In[16]:


import pandas as pd

df = df[df["balls"] > 0].copy()

first_names = df.groupby("player_id")["name"].first().to_dict()
df["name"] = df["player_id"].map(first_names)

def match_to_quarter(m):
    if 1 <= m <= 3: return 1
    if 4 <= m <= 6: return 2
    if 7 <= m <= 9: return 3
    if 10 <= m <= 12: return 4
    if 13 <= m <= 15: return 5
    if 16 <= m <= 17: return 6

df["quarter"] = df["match_no"].apply(match_to_quarter)

per_q = (
    df.groupby(["player_id", "name", "quarter"])
      .agg(
          matches=("runs", "size"),
          avg_runs=("runs", "mean"),
          avg_sr=("strike_rate", "mean")
      )
      .reset_index()
)

w_runs, w_sr = 0.7, 0.3
per_q["perf_index"] = w_runs * per_q["avg_runs"] + w_sr * per_q["avg_sr"]

per_q = per_q.sort_values(["player_id", "quarter"])
per_q["prev_perf"] = per_q.groupby("player_id")["perf_index"].shift(1)
per_q["qoq_change_pct"] = ((per_q["perf_index"] - per_q["prev_perf"]) / per_q["prev_perf"] * 100)

def classify(x):
    if pd.isna(x): return "N/A"
    if x > 10: return "Improving"
    if x < -10: return "Declining"
    return "Stable"

per_q["trend"] = per_q["qoq_change_pct"].apply(classify)

def phase(trends):
    last = trends.iloc[-1]
    if last == "Improving": return "Career Ascending"
    if last == "Declining": return "Career Declining"
    if len(trends) > 1:
        prev = trends.iloc[-2]
        if prev == "Improving": return "Career Ascending"
        if prev == "Declining": return "Career Declining"
    return "Career Stable"

career_phase = (
    per_q.groupby("player_id")["trend"]
         .apply(phase)
         .rename("career_phase")
)

final_output = per_q.merge(career_phase, on="player_id", how="left")

final_output = final_output.sort_values(["player_id", "quarter"])[
    ["player_id", "name", "quarter", "matches", "avg_runs", "avg_sr",
     "perf_index", "prev_perf", "trend", "career_phase"]
]


